import React, { Component, useState } from "react";
import axios from "axios";

class Temp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: this.props.lat,
      lon: this.props.lon,
      test: this.props.test,
      temp: 666,
      wind: 666,
    };
  }
  getTempInfo = () => {
    axios
      .get(
        `http://api.openweathermap.org/data/2.5/weather?lat=${this.props.lat}&lon=${this.props.lon}&appid=8f61a1e09924a4c204d0927cfe0ff964`
      )
      .then((response) => {
        let data = response.data;
        console.log(data);
        this.setState({
          temp: data.main.temp,
          wind: data.wind.speed,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };
  componentDidMount() {
    this.getTempInfo();
  }
  render() {
    return (
      <div>
        <p>Temperie: {this.state.temp}</p>
        <p>Windie: {this.state.wind}</p>
        <p>Lat from prop : {this.props.lat}</p> {/* Successful */}
        <p>Lon from prop : {this.props.lon}</p> {/* Successful */}
        <p>{this.state.lat}</p>
        <p>{this.state.lon}</p>
      </div>
    );
  }
}

export default Temp;
